import React, { Component } from 'react';
import logo from './images/mee.png';
import './App.css';
import { BrowserRouter, Route} from "react-router-dom";
import DashBoard from "./components/DashBoard"

class App extends Component {
  render() {
    return (
      <div className="App">
        <DashBoard />
      </div>
    );
  }
}

export default App;
